import { configureStore } from "@reduxjs/toolkit";
import { Provider } from "react-redux";
import chatReducer from "./chatSlice";
import ChatUI from './Components/chat';

const store = configureStore({
  reducer: {
    chat: chatReducer,
  },
});

function App() {
  return (
    <Provider store={store}>
      <ChatUI />
    </Provider>
  );
}

export default App;
